package com.kj.favanime.models;import javax.persistence.*;import java.io.Serializable;@Entitypublic class AnimeList implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(nullable = false, updatable = false)    private Long id;    private Long mal_id;    private Integer anime_rank;    private String title;    private String url;    private String image_url;    private String type;    private String start_date;    private String end_date;    private Integer episodes;    private Integer members;    private Integer score;    public AnimeList(Long id) {        this.id = id;    }    @Override    public String toString() {        return "AnimeList{" +                "id=" + id +                ", mal_id=" + mal_id +                ", anime_rank=" + anime_rank +                ", title='" + title + '\'' +                ", url='" + url + '\'' +                ", image_url='" + image_url + '\'' +                ", type='" + type + '\'' +                ", start_date='" + start_date + '\'' +                ", end_date='" + end_date + '\'' +                ", episodes=" + episodes +                ", members=" + members +                ", score=" + score +                '}';    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public AnimeList(Long mal_id, Integer anime_rank, String title, String url, String image_url, String type, String start_date, String end_date, Integer episodes, Integer members, Integer score) {        this.mal_id = mal_id;        this.anime_rank = anime_rank;        this.title = title;        this.url = url;        this.image_url = image_url;        this.type = type;        this.start_date = start_date;        this.end_date = end_date;        this.episodes = episodes;        this.members = members;        this.score = score;    }    public AnimeList() {    }    public Long getMal_id() {        return mal_id;    }    public void setMal_id(Long mal_id) {        this.mal_id = mal_id;    }    public Integer getAnime_rank() {        return anime_rank;    }    public void setAnime_rank(Integer anime_rank) {        this.anime_rank = anime_rank;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public String getImage_url() {        return image_url;    }    public void setImage_url(String image_url) {        this.image_url = image_url;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getStart_date() {        return start_date;    }    public void setStart_date(String start_date) {        this.start_date = start_date;    }    public String getEnd_date() {        return end_date;    }    public void setEnd_date(String end_date) {        this.end_date = end_date;    }    public Integer getEpisodes() {        return episodes;    }    public void setEpisodes(Integer episodes) {        this.episodes = episodes;    }    public Integer getMembers() {        return members;    }    public void setMembers(Integer members) {        this.members = members;    }    public Integer getScore() {        return score;    }    public void setScore(Integer score) {        this.score = score;    }}